doc:
Returns an iterator visiting all values in the underlying vector, in
arbitrary order.

# Examples

Basic usage:

```
use std::collections::BinaryHeap;
let heap = BinaryHeap::from([1, 2, 3, 4]);

// Print 1, 2, 3, 4 in arbitrary order
for x in heap.iter() {
    println!("{x}");
}
```
